import React, { useState } from 'react';
function LoginForm() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const handleLogin = () => {
    // Perform authentication logic here
    setIsLoggedIn(true);
    window.location.href = '/chat';

  };
  return (
    <div>
      <h1>Login</h1>
      <button onClick={handleLogin}>Log In</button>
    </div>
  );
}
export default LoginForm;
